INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'10', N'', N'Cool Template Tricks', CAST(N'2015-02-26 13:15:00.000' AS DateTime), 0, N'<p>We''ll take a look at some of the cool stuff you can do in Razor templates. Having the full power of C# in your templates makes a lot of things easier, and this session will give you recipes for solving many of those small tasks you may encounter in your daily work. We will work with Razor, Feeds, AJAX, JSON and publishing in general.</p>
', 36, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'12', N'', N'Email Marketing A-Z', CAST(N'2015-02-26 13:15:00.000' AS DateTime), 0, N'<p>In this session we will take a journey through the entire Email Marketing area of Dynamicweb from an implementer and editors perspective. How does it work from basic newsletters till advanced marketing automation.</p>
', 40, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'13', N'', N'Lunch', CAST(N'2015-02-26 12:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'14', N'', N'ASP.NET 5', CAST(N'2015-02-26 14:30:00.000' AS DateTime), 0, N'<p>Evolution or revolution? That''s the question that the developer community has responded with when Microsoft announced the new generation of ASP.NET. ASP.NET has been revamped to a very large degree by consolidating MVC and Web API and decoupling System.Web from the ASP.NET stack. Microsoft Tech Evangelist Sebastian Brandes will get through the major news of ASP.NET 5 and provide in-depth demos of each of the new features. Join this session for a fun and interactive look into the future of <a href="http://ASP.NET">ASP.NET</a></p>
', 42, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'15', N'', N'Dynamicweb vNext', CAST(N'2015-02-26 15:30:00.000' AS DateTime), 0, N'<p>Evolution or revolution? The future of Dynamicweb! Where are we heading and how will we adopt technologies like ASP.NET 5. Join this session to learn about the Dynamicweb&nbsp;future.</p>
', 44, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'16', N'', N'Dynamicweb UX Sounding Board', CAST(N'2015-02-26 16:15:00.000' AS DateTime), 0, N'<p>Give your input on the user experience in future versions of Dynamicweb.</p>
', 46, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'17', N'', N'Dynamicweb - Technical Sounding Board', CAST(N'2015-02-26 16:15:00.000' AS DateTime), 0, N'<p>With the future releases of Dynamicweb&nbsp;the technology&nbsp;will be changed in the core of the platform - in this sounding board we are interested in knowing about how you work with the platform now and what you believe should be adjusted in the future.</p>
', 48, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'18', N'', N'Marketing Integration', CAST(N'2015-02-26 16:15:00.000' AS DateTime), 0, N'<p>Come see how we at Dynamicweb have set up an integration between Dynamicweb and Microsoft CRM. See how contacts and contact/account data is made available to Email Marketing for targeting campaigns and how Email Marketing responses and leads from visitors are made available to our sales people in CRM.</p>
', 50, 0, N'3', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'19', N'', N'Beer tasting', CAST(N'2015-02-26 18:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'2', N'', N'Opening Keynote', CAST(N'2015-02-26 09:30:00.000' AS DateTime), 0, N'<p>Welcome to this year''s Dynamicweb Tech Conference. This opening keynote sets the scene for the conference with an introduction to the program. We will also travel back in time by showing you highlights from 8.5 and 8.6 plus give you a brief on the future roadmap.</p>
', 14, 2, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'20', N'', N'Getting pretty for dinner', CAST(N'2015-02-26 17:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'21', N'', N'Dinner', CAST(N'2015-02-26 19:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'22', N'', N'Drinks / Beer / Spa', CAST(N'2015-02-26 21:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'23', N'', N'Breakfast', CAST(N'2015-02-27 08:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'24', N'', N'Search and you will find', CAST(N'2015-02-27 09:05:00.000' AS DateTime), 0, N'<p>With the release of Dynamicweb 8.6 we introduced a new searching framework based on a pluggable indexing layer. It can be daunting to get started so we will take you by the hand and guide you through the process.</p>
', 54, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'25', N'', N'Reusable Dynamicweb implementations', CAST(N'2015-02-27 10:15:00.000' AS DateTime), 0, N'<p>How can we use configurable themes and reusable components in the implementation that can be reused on more Dynamicweb sites with minimal re-implementation? Introducing the "multi purpose paragraph", bootstrap oriented layout item and optimization of how we can control rendering in the responsive world.</p>
', 56, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'26', N'', N'Indexing everything', CAST(N'2015-02-27 10:15:00.000' AS DateTime), 0, N'<p>Historically, using indexes in Dynamicweb has been limited to Ecommerce and Products. With the introduction of the new searching framework, we now have the option of indexing everything imaginable. We will go through setting up custom indexes and queries, and we will take a look at the options available through code.</p>
', 58, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'27', N'', N'Integration Framework - Workshop', CAST(N'2015-02-27 10:15:00.000' AS DateTime), 0, N'<p>Bring your laptop and your problems - get hands on experience with the Integration Framework and help from the experts.&nbsp;</p>

<p>We will setup a Dynamics NAV so you can try to set up an integration to your local Dynamicweb. If you are working with Integration and are having questions or problems - this is the place to be.</p>
', 60, 0, N'3', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'28', N'', N'Break', CAST(N'2015-02-27 11:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'29', N'', N'New Ecommerce Features', CAST(N'2015-02-27 11:30:00.000' AS DateTime), 0, N'<p>In the latest releases of Dynamicweb, we have introduced a lot of new features especially in Ecommerce. These features include Loyalty Points, Assortments, Quotes and Context Carts. In the session we will go through the implementation and the API for some of these features.</p>
', 62, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'3', N'', N'Items - Why?', CAST(N'2015-02-26 10:00:00.000' AS DateTime), 0, N'<p>Most of the community have adapted items in Dynamicweb - but for those of you who are still in doubt, this session will explain why! We''ll talk about how items make the life easier for content editors and frontend implementers.</p>
', 16, 3, N'1', N'1')
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'30', N'', N'Combining your code with Glimpse', CAST(N'2015-02-27 11:30:00.000' AS DateTime), 0, N'<p>Most implementers and developers need to be able to debug in live environments - in this session Soren from NORRIQ will give us an introduction to Glimpse, show us how to get it working with Dynamicweb and finally show some of his really cool tricks for working with Glimpse in his everyday work.</p>
', 64, 0, N'3', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'31', N'', N'Integrating Users', CAST(N'2015-02-27 13:30:00.000' AS DateTime), 0, N'<p>In this session we will demo the functionality available in Dynamicweb for integrating users. External login providers (like Facebook and Google) and Internal providers like AD.</p>
', 72, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'32', N'', N'Lunch', CAST(N'2015-02-27 12:30:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'33', N'', N'Kill a module in 60 minutes', CAST(N'2015-02-27 13:30:00.000' AS DateTime), 0, N'<p>Breaking news: No news (module)</p>

<p>In this session we''ll build a news "module" from scratch using items. First we''ll create items for creating and editing news, then we''ll create templates for showing lists of news and news in detail. Finally we''ll discuss what''s missing - if any - before we can replace other modules with item implementations.</p>
', 68, 0, N'1', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'34', N'', N'Break', CAST(N'2015-02-26 14:15:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'35', N'', N'Recommendations', CAST(N'2015-02-27 11:30:00.000' AS DateTime), 0, N'<p>Last year we gave an introduction to our recommendations project - a year has passed and Mikkel will take you through the concept, the implementation and what will happen in the future of recommendations in Dynamicweb.</p>
', 66, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'36', N'', N'Dynamicweb in the Cloud', CAST(N'2015-02-26 13:15:00.000' AS DateTime), 0, N'<p>This is a session where we will talk about scaling and increasing performance of Dynamicweb in the production - how can we optimize the hosting. We will take a look at the new NLB and install a Dynamicweb solution on Azure and setup the CDN on Amazon Web Services.</p>
', 34, 0, N'3', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'37', N'', N'Closing', CAST(N'2015-02-27 14:30:00.000' AS DateTime), 0, N'<p>See you next year at #DWTC16</p>

<p>Goodbye beers!</p>
', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'38', N'', N'Break', CAST(N'2015-02-27 10:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'39', N'', N'Break', CAST(N'2015-02-26 16:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'4', N'', N'TypeScript', CAST(N'2015-02-26 10:00:00.000' AS DateTime), 0, N'<p>In this session we will build an Angular-based app using TypeScript from scratch to demonstrate the desired benefits of this fantastic superset!</p>
', 24, 0, N'2', N'3')
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'40', N'', N'Forms 2015', CAST(N'2015-02-27 09:05:00.000' AS DateTime), 0, N'<p>Dynamicweb 8.6 contains a new template based forms module to replace the long running original forms. See it in action, see the new features, how templates work, using it with bootstrap and more. The session ends with your ideas for further features.</p>
', 52, 0, N'2', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'42', N'', N'Welcome to day 2', CAST(N'2015-02-27 09:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'43', N'', N'Publishing Dynamicweb content in XML & JSON', CAST(N'2015-02-27 13:30:00.000' AS DateTime), 0, N'<p>.</p>
', 70, 0, N'3', NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'5', N'', N'How Dynamicweb supports a customer lifecycle', CAST(N'2015-02-26 11:15:00.000' AS DateTime), 0, N'<p>Ever wondered what this All-in-one platform means for the customer? Asger from DIS/PLAY will have a look at a customer lifecycle and talk about how the capabilities of Dynamicweb All-in-One can support this in order to optimize your digital business.</p>
', 30, 0, N'2', N'1')
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'6', N'', N'Break', CAST(N'2015-02-26 11:00:00.000' AS DateTime), 1, N'', NULL, 0, NULL, NULL)
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'7', N'', N'Items - New cool things', CAST(N'2015-02-26 11:15:00.000' AS DateTime), 0, N'<p>With items fully integrated into Dynamicweb a lot of new features have been implemented. In this session, we will highlight some of the new item features like stronger relations between items, inheritance and item types as fields, and have a discussion about how this can make your life easier as an implementer.</p>
', 28, 0, N'1', N'2')
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'8', N'', N'8.5 & 8.6 overview', CAST(N'2015-02-26 10:00:00.000' AS DateTime), 0, N'<p>Still not an expert in the latest Dynamicweb versions? No problem - join us for this presentation and demo of Dynamicweb 8.5 and 8.6.</p>
', 26, 0, N'3', N'1')
INSERT [dbo].[ItemType_Dwtc15_Session] ([Id], [ItemInstanceType], [Title], [StartTime], [IsBreak], [Description], [Speakers], [Sort], [Location], [TechnicalLevel]) VALUES (N'9', N'', N'Integrating ERP and PIM', CAST(N'2015-02-26 11:15:00.000' AS DateTime), 0, N'<p>This session introduces how to integrate to both ERP and PIM in one solution using Microsoft NAV&nbsp;and skyPIM. We will give you a basic introduction to the overall concept of the Integration Framework with best practices and relevant cases.</p>
', 32, 0, N'3', N'2')
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'1', N'Dwtc15_Speaker', N'<p>Mikkel has worked with web programming and web technologies ever since taking his first steps onto the internet back in the summer of ''95. Before joining Dynamicweb, Mikkel worked in the publishing industry for many years, and he''s no stranger to the challenges we''re facing with getting good content onto the web and present it in useful and beautiful ways.</p>
', N'', 0, N'', N'Developer Evangelist', 86)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'2', N'Dwtc15_Speaker', N'<p>Soren is a Technical Solutions Architect in teams developing international B2B and B2C sites with integration to ERP/CRM/PIM-systems. He focus on cross project development optimization and has a flair for combining different technologies to solve real world problems.</p>
', N'', 0, N'', N'Technical Solutions Architect', 20)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'3', N'Dwtc15_Speaker', N'<p>Sebastian is a Tech Evangelist in Microsoft where he works with Modern Apps, Cloud Computing and Developer Tools. He has a great passion for technology (ranging from tiny embedded systems with Arduino/Netduino to large-scale cloud solutions in Azure) and focuses on driving Microsoft technologies forward on all kinds of different platforms.</p>
', N'', 0, N'', N'Tech Evangelist', 82)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'4', N'Dwtc15_Speaker', N'<p>Line is an expert in configuring and implementing Dynamicweb ecommerce.</p>
', N'', 0, N'', N'Technical supporter', 89)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'5', N'Dwtc15_Speaker', N'<p>As Digital Director at the Dynamicweb partner DIS/PLAY, Asger works on leveraging digital business potential for a number of Danish customers. The focus is on creating and optimizing Ecommerce and Online Marketing solutions. Asger has worked within the business for 10 years including several years as Product Manager at Dynamicweb.</p>
', N'', 0, N'', N'Digital Director', 88)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'6', N'Dwtc15_Speaker', N'<p>Jesper is an experienced solution architect capable of combining business strategies with technology decisions that translates into value-adding digital solutions. Jesper has recently joined Dynamicweb, but contributes with more than 16 years of experience in building and delivering complex solutions.</p>
', N'', 0, N'', N'Solution Architect', 87)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'7', N'Dwtc15_Speaker', N'<p>Jeppe has been in Dynamicweb since 2008. He''s the man behind modules such as Data Lists and Email Marketing and he was one of the driving forces behind Cart V2 and Product Categories. In connection with the development of Dynamicweb 8, Jeppe was heavily involved with refactoring the Ecommerce API. His continuing mission is to improve the performance of Dynamicweb CMS and eCommerce. To that end, he was one of the architects of the new searching and indexing functionality.</p>
', N'', 0, N'', N'Senior Software Developer', 85)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'8', N'Dwtc15_Speaker', N'<p>Since he joined Dynamicweb in 2010, Jonas has been working with most parts of the software. However, his specialty is still the integration functionality, which he has helped develop and improve over the last four years. He is currently heavily involved in the daily work of the Dynamicweb teams in Russia and Ukraine.</p>
', N'', 0, N'', N'Senior Software Developer', 84)
INSERT [dbo].[ItemType_Dwtc15_Speaker] ([Id], [ItemInstanceType], [Biography], [Homepage], [Sort], [Image], [Title], [Company]) VALUES (N'9', N'Dwtc15_Speaker', N'<p>With a broad and deep knowledge of internet technologies, how they are applied and how they work together, Mr. Hoeg Pedersen is the Chief Product Owner and visionary for the technical development of the Dynamicweb products.</p>
', N'', 0, N'', N'Chief Product Owner', 83)
